// HasProperty applies the HasEdge predicate on the "property" edge.
func HasProperty() predicate.Building {
	return predicate.Building(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, PropertyTable, PropertyColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasPropertyWith applies the HasEdge predicate on the "property" edge with a given conditions (other predicates).
func HasPropertyWith(preds ...predicate.Property) predicate.Building {
	return predicate.Building(func(s *sql.Selector) {
		step := newPropertyStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// HasSpaces applies the HasEdge predicate on the "spaces" edge.
func HasSpaces() predicate.Building {
	return predicate.Building(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, SpacesTable, SpacesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSpacesWith applies the HasEdge predicate on the "spaces" edge with a given conditions (other predicates).
func HasSpacesWith(preds ...predicate.Space) predicate.Building {
	return predicate.Building(func(s *sql.Selector) {
		step := newSpacesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Building) predicate.Building {
	return predicate.Building(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Building) predicate.Building {
	return predicate.Building(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Building) predicate.Building {
	return predicate.Building(sql.NotPredicates(p))
}
